import React from 'react';
import './progresscard.css';

class ProgressCard extends React.Component {
  constructor(props) {
    super(props);
    
    this.state = {
      category: 'animals'
    }
  }
 

  render () {
    return (
    <div>
      <h2>{this.state.category}</h2>
    </div>
    );
  }
}

export default ProgressCard;
